class User extends Sequelize.Model {
  static init(sequelize, DataTypes) {
    return super.init(
      {
        id: { type: Sequelize.STRING, primaryKey: true, autoIncrement: true },
        name: { type: Sequelize.STRING, allowNull: false },
        office_email: { type: Sequelize.STRING, allowNull: false },
        personal_email: { type: Sequelize.STRING, allowNull: false },
        designation: { type: Sequelize.STRING, allowNull: false },
        shift: { type: Sequelize.STRING, allowNull: false },
        status: { type: Sequelize.TINYINT, allowNull: false },
        username: { type: Sequelize.STRING, allowNull: false },
        password: { type: Sequelize.STRING, allowNull: false },
        dob: { type: Sequelize.DATEONLY, allowNull: true },
        aadhar_number: { type: Sequelize.STRING, allowNull: true },
        pan_number: { type: Sequelize.STRING, allowNull: true },
        contact_number: { type: Sequelize.STRING, allowNull: true },
        emergency_number: { type: Sequelize.STRING, allowNull: true },
        doj: { type: Sequelize.DATEONLY, allowNull: true },
        permanent_address: { type: Sequelize.TEXT, allowNull: true },
        temporary_address: { type: Sequelize.TEXT, allowNull: true },
        marital_status: { type: Sequelize.STRING, allowNull: true },
        passkey: { type: Sequelize.STRING, allowNull: true },
        timeout: { type: Sequelize.DATE, allowNull: true }
      },
      { sequelize, modelName: "employees", timestamps: false }
    );
  }
}

export default User;

